	(8, 1, '2020-12-12 02:43:12', '2020-12-12 02:43:12', '<div class=\"page\" title=\"Page 36\">\r\n<div class=\"layoutArea\">\r\n<div class=\"column\">\r\n\r\nAt its heart, Computer Science is about problem solving. That is not to say that only Computer Science is about problem solving. It would be hubris to think that Computer Science holds a monopoly on “problem solving.” Indeed, it would be hard to find any discipline in which solving problems was not a substantial aspect or motivation if not integral. Instead, _______________ is the study of computers and computation. It involves studying and understanding computational processes and the development of algorithms and techniques and how they apply to problems.\r\n\r\n</div>\r\n</div>\r\n</div>', '', '', 'publish', 'closed', 'closed', '', '8', '', '', '2020-12-12 02:44:55', '2020-12-12 02:44:55', '', 0, 'http://vccw.test/?post_type=question&#038;p=8', 0, 'question', '', 0),
